import Product1 from '../images/Products/Product1.png';

const ProductCategories=[
    {
        id:1,
        title: "product1",
        price: 200,
        image:{Product1},
    },
    {
        id:1,
        title: "product1",
        price: 200,
        image: {Product1}
    },
    {
        id:1,
        title: "product1",
        price: 200,
        image:"../images/Products/Category1.jpg"
    },
    {
        id:2,
        title: "product2",
        price: 400,
        image:"../images/Products/Category2.jpg"
    },
]

export default ProductCategories;
